import './App.css';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import { Button, TextField } from '@material-ui/core';

function App() {
  const [selectedDate, setSelectedDate] = React.useState(new Date('2014-08-18T21:11:54'));

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  return (
    <Container>
      <form className="InputForm">
        <TextField className="inputName" id="outlined-basic" label="Outlined" variant="outlined" />
        <KeyboardDatePicker
          className="inputDate"
          disableToolbar
          variant="inline"
          format="MM/dd/yyyy"
          margin="normal"
          id="date-picker-inline"
          label="Date picker inline"
          value={selectedDate}
          onChange={handleDateChange}
          KeyboardButtonProps={{
            'aria-label': 'change date',
          }}
        />
        <TextField className="inputContext" id="outlined-basic" label="Outlined" variant="outlined" />
        <Button className="submitBtn" variant="outlined" color="primary">
          Submit
        </Button>
      </form>
    </Container>
  );
}

export default App;
